/*
 * @Author: renlei
 * @Date: 2020-05-18 16:26:56
 * @LastEditors: renlei
 * @LastEditTime: 2020-05-18 16:44:28
 * @Description:
 */

export default () => (
  <div>
    Hello world
    <p>scoped!</p>
    <style jsx>{`
      p {
        color: blue;
      }
      div {
        background: red;
      }
      @media (max-width: 600px) {
        div {
          background: blue;
        }
      }
    `}</style>
    <style global jsx>{`
      body {
        background: black;
      }
    `}</style>
  </div>
);
